import{_ as e,o,c as r,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 3.2-6504.1 Civil immunity; forcible entry of motor vehicle to remove unattended companion animal.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-6504.1.md","filePath":"vacode/3.2-6504.1.md"}'),i={name:"vacode/3.2-6504.1.md"},t=a('<h1 id="§-3-2-6504-1-civil-immunity-forcible-entry-of-motor-vehicle-to-remove-unattended-companion-animal" tabindex="-1">§ 3.2-6504.1 Civil immunity; forcible entry of motor vehicle to remove unattended companion animal. <a class="header-anchor" href="#§-3-2-6504-1-civil-immunity-forcible-entry-of-motor-vehicle-to-remove-unattended-companion-animal" aria-label="Permalink to &quot;§ 3.2-6504.1 Civil immunity; forcible entry of motor vehicle to remove unattended companion animal.&quot;">​</a></h1><p>No law-enforcement officer as defined in § <a href="http://law.lis.virginia.gov/vacode/9.1-101/" target="_blank" rel="noreferrer">9.1-101</a>, firefighter as defined in § <a href="http://law.lis.virginia.gov/vacode/65.2-102/" target="_blank" rel="noreferrer">65.2-102</a>, emergency medical services personnel as defined in § <a href="http://law.lis.virginia.gov/vacode/32.1-111.1/" target="_blank" rel="noreferrer">32.1-111.1</a>, or animal control officer who in good faith forcibly enters a motor vehicle in order to remove an unattended companion animal that is at risk of serious bodily injury or death shall be liable for any property damage to the vehicle entered or injury to the animal resulting from such forcible entry and removal of the animal, unless such property damage or injury results from gross negligence or willful or wanton misconduct.</p><p>2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0679" target="_blank" rel="noreferrer">679</a>.</p>',3),n=[t];function l(c,m,d,s,f,h){return o(),r("div",null,n)}const p=e(i,[["render",l]]);export{_ as __pageData,p as default};
